import React from 'react'

const Header = (color) => {
    
  return (
    <>
    <div className="container">
        <h2 style={ color}>FEEDBACK UI</h2>
    </div>
    </>
  )
}

Header.defaultProps  = {
    bgColor: 'yellow',
    color: 'blue'
}

export default Header;
